import { configureStore } from "@reduxjs/toolkit";
import { useReducer } from "react";
import basketReducer from './basket/basketSlice'
import userReducer from './'

export default configureStore({
    reducer:{
        basket: basketReducer,
        user: userReducer
    }
})
